// src/App.js
import React from 'react';
// import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import Cards from './components/Cards';
import InfoCard from './components/InfoCard';

const Computers = () => <h2>Компьютеры</h2>;
const Laptops = () => <h2>Ноутбуки</h2>;
const Monitors = () => <h2>Мониторы</h2>;
const Peripherals = () => <h2>Периферия</h2>;

function App() {
  return (
    <div>
      <Header/>
      <Cards/>
      <InfoCard/>
    </div>
  );
}

export default App;
